import React from 'react';

class Footer extends React.Component {
  render() {
    return (
      <div>
        <footer class="page-footer font-small bg-secondary">
          <div class="footer-copyright text-center py-3">Copyright Footer</div>
        </footer>
      </div>
    );
  }
}

export default Footer;
